// src/pages/projects/QcmBuilder.jsx
import { motion } from "framer-motion";
import BackToHome from "../../components/BackToHome";

export default function QcmBuilder() {
  return (
    <section className="min-h-screen py-16 px-6 bg-white">
      <div className="max-w-5xl mx-auto">
        <motion.h1
          className="text-4xl font-bold mb-4"
          initial={{ opacity: 0, y: -20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.6 }}
        >
          SAE ‚Äì QCM Builder
        </motion.h1>

        <BackToHome />

        <motion.p
          className="text-gray-600 mb-8 text-lg"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.2, duration: 0.6 }}
        >
          Ce projet, d√©velopp√© dans le cadre d‚Äôune SAE en √©quipe, vise √† fournir aux enseignants un outil complet de g√©n√©ration d‚Äô√©valuations pour permettre aux √©tudiants de s‚Äôauto-√©valuer efficacement.
        </motion.p>

        <motion.img
          src="/assets/app_qcm_builder/img_app_qcm_builder.png"
          alt="Capture d'√©cran QCM Builder"
          className="rounded-lg shadow mb-10 w-full object-cover"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.3, duration: 0.6 }}
          onError={(e) => {
            e.target.src = "https://via.placeholder.com/900x400?text=Image+non+trouv√©e";
            e.target.onerror = null;
          }}
        />

        <motion.div
          className="space-y-6"
          initial={{ opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ delay: 0.4, duration: 0.6 }}
        >
          <div>
            <h2 className="text-2xl font-semibold mb-2">Fonctionnalit√©s principales</h2>
            <ul className="list-disc list-inside text-gray-700">
              <li>Cr√©ation de diff√©rentes typologies de questions (QCM, association, √©limination)</li>
              <li>Param√©trage des ressources, notions et niveaux de difficult√©</li>
              <li>G√©n√©ration d‚Äôune fiche d‚Äô√©valuation HTML/CSS/JS</li>
              <li>Support de fichiers compl√©mentaires (PDF, images, audio, etc.)</li>
              <li>Application distincte pour √©tudiants avec syst√®me de feedback</li>
            </ul>
          </div>

          <div>
            <h2 className="text-2xl font-semibold mb-2">Mon r√¥le</h2>
            <p className="text-gray-700">
              J‚Äôai grandement contribu√© au d√©veloppement du front-end de l‚Äôapplication d√©di√©e aux enseignants, en Java (principalement avec Swing). J‚Äôai √©galement particip√© au back-end, notamment sur le traitement des fichiers et l'int√©gration des types de questions. J‚Äôai aussi facilit√© la coordination technique avec le reste de l‚Äô√©quipe.
            </p>
          </div>

          <div>
            <h2 className="text-2xl font-semibold mb-2">Stack technique</h2>
            <ul className="list-disc list-inside text-gray-700">
              <li>Java (langage principal)</li>
              <li>Swing (interface enseignant)</li>
              <li>HTML, CSS, JavaScript (fiche d‚Äô√©valuation √©tudiant)</li>
              <li>Fichiers RTF & CSV pour le stockage des donn√©es</li>
              <li>Organisation modulaire, architecture MVC</li>
            </ul>
          </div>

          <div className="mt-6 flex gap-4">
            <a
              href="https://github.com/pierrecvn/QCMBuilder"
              target="_blank"
              rel="noopener noreferrer"
              className="inline-block px-6 py-3 bg-gray-100 hover:bg-gray-200 border border-gray-300 rounded text-sm font-medium"
            >
              üîó Voir le code sur GitHub
            </a>
          </div>
        </motion.div>
      </div>
    </section>
  );
}
